import { createBrowserRouter } from "react-router-dom";
import "./App.css";
import MainLayOut from "./Pages/MainLayOut/MainLayOut";
import Register from "./Pages/Register/Register";

createBrowserRouter([
  {
    path: "",
    element: <MainLayOut />,
    children: [
      {
        path: "Register",
        element: <Register />,
      },
      {
        path:"Cart"
      }
    ],
  },
]);

function App() {
  return "";
}

export default App;
